import React from "react";
import "./css/App.css";

import css from "./assets/css-3.png";
import C from "./assets/c.png";
import html from "./assets/html-5.png";
import javascript from "./assets/icons8-javascript-48.png";
import python from "./assets/python.png";
import java from "./assets/java.jpg";
import mysql from "./assets/mysql.jpg";
import django from "./assets/django.jpg";
import react from "./assets/react.jpg";
import star from "./assets/star.jpg";

const Skills = () => {
  return (
    <div className="container mt-4 pt-4">
      <center>
        <span className="text-dark text-center head">My Skills</span>
      </center>

      <div className="container">
          <div className="row justify-content-around  mb-4 ">
            <div className="col-3 ">
              <img src={html} className="img " alt="HTML logo" />
            </div>
            
            <div className="col-2 pt-lg-5">
              <img src={star} className="img1 " alt="HTML logo" />
              <img src={star} className="img1 " alt="HTML logo" />
              <img src={star} className="img1 " alt="HTML logo" />
              <img src={star} className="img1 " alt="HTML logo" />
              <img src={star} className="img1 " alt="HTML logo" />
            </div>
            <div className="col-3 ">
              <img src={html} className="img " alt="HTML logo" />
            </div>
            <div className="col-2 ">
              <img src={star} className="img1 " alt="HTML logo" />
              <img src={star} className="img1 " alt="HTML logo" />
              <img src={star} className="img1 " alt="HTML logo" />
              <img src={star} className="img1 " alt="HTML logo" />
              <img src={star} className="img1 " alt="HTML logo" />
            </div>
          </div>
          <div className="row justify-content-around  mb-4">
          <img src={javascript} className="img col-3 m-lg-3" alt="Javascript logo" />
          <img src={mysql} className="img col-3 m-lg-3" alt="mysql logo" />
        </div>
        <div className="row justify-content-around  mb-4">
        <img src={python} className="img col-3 m-lg-3" alt="Python logo" />
        <img src={java} className="img col-3 m-lg-3" alt="Java logo" />
      </div>
      <div className="row justify-content-around  mb-4">
        <img src={react} className="img col-3 m-lg-3" alt="react logo" />
        <img src={django} className="img col-3 m-lg-3" alt="django logo" />
      </div>
      </div>
    </div>
  );
};

export default Skills;
